  downloadPdf() {
    console.log(this.platform)
    if (this.platform.is('android')) {
      this.pdfObj.getBuffer((data) => {
        let utf8 = new Uint8Array(data);
        let binaryArray = utf8.buffer;
        this.file.writeFile(this.file.externalDataDirectory, this.refNo + '.pdf', binaryArray, { replace: true })
          this.fileOpener.open(this.file.externalDataDirectory + this.refNo + '.pdf', 'application/pdf'); //pdf i otomatik açar
          if (this.serverService.Settings.G3Settings.SendReceiptViaMail) {
            this.sendEmail(this.file.externalDataDirectory + this.refNo + '.pdf');
          }
       
      });
    } else if (this.platform.is('ios')) {
      this.pdfObj.getBuffer((data) => {
        let utf8 = new Uint8Array(data);
        let binaryArray = utf8.buffer;
        this.file.writeFile(this.file.documentsDirectory, this.refNo + '.pdf', binaryArray, { replace: true })
          this.fileOpener.open(this.file.documentsDirectory + this.refNo + '.pdf', 'application/pdf');
          if (this.serverService.Settings.G3Settings.SendReceiptViaMail) {
            this.sendEmail(this.file.documentsDirectory + this.refNo + '.pdf');
          }
        
      });
    } else {
      // On a browser simply use download!
      this.pdfObj.download();
    }
  }
